import numpy as np
from numpy import dot
from numpy.linalg import norm
from dotenv import load_dotenv, find_dotenv
import os
import sys

# 加载环境变量
_ = load_dotenv(find_dotenv())

from openai import OpenAI
client = OpenAI()
print("----------------- 1 ------------------")

def cos_sim(a, b):
    '''余弦距离 -- 越大越相似'''
    return dot(a, b)/(norm(a)*norm(b))

def l2(a, b):
    '''欧式距离 -- 越小越相似'''
    x = np.asarray(a)-np.asarray(b)
    return norm(x)

